"5951":{"id":"5951","name":"O Clube de Leitura de Jane Austen","slug":"o-clube-de-leitura-de-jane-austen","original_title":"The Jane Austen Book Club","overview":"Mulheres de todas as idades fazem parte de um clube do livro sobre as obras de Jane Austen, responsável por títulos como Orgulho e Preconceito, Razão e Sensibilidade e Persuasão. Nessas reuniões, elas discutem as lições aprendidas nos livros, tentando resolver seus relacionamentos ou pelo menos arranjar um.","first_air_date":"2007-09-09","runtime":106,"episode_run_time":[106],"vote_average":6.5,"created_by":["Mockingbird Pictures","John Calley Productions"],"production_companies":[{"name":"Mockingbird Pictures"},{"name":"John Calley Productions"}],"cast":["Kathy Baker","Maria Bello","Emily Blunt","Amy Brenneman","Hugh Dancy"],"backdrop_path":"https://image.tmdb.org/t/p/original/6Uw2IGTqNAz8l5wXxKc9LJB99Dm.jpg","poster_path":"https://image.tmdb.org/t/p/original/5LMQ0JaW79a47Z1bpomKgpAMU7W.jpg","certification":"14","genres":["Comédia","Romance"],"trailer":"N/A"},
