"538061":{"id":"538061","name":"A Tabacaria","slug":"a-tabacaria","original_title":"Der Trafikant","overview":"Franz é um rapaz de 17 anos de idade que chega a Viena para trabalhar como aprendiz em uma tabacaria. Ali, ele conhece Sigmund Freud, um cliente frequente. Com o passar do tempo, os dois, apesar de origens muito distintas, desenvolvem uma amizade única. Quando Franz se apaixona perdidamente pela dançarina Anezka, ele busca os conselhos de seu amigo Sigmund, que, apesar de ser um renomado psicanalista, admite que o sexo feminino é um grande mistério para ele em termos românticos. A tensão política e social aumenta dramaticamente na Áustria, piorando com a chegada dos nazistas à capital. Franz, Sigmund e Anezka se perdem no meio do caos da cidade e cada um terá uma decisão difícil para tomar: ficar ou fugir de Viena?","first_air_date":"2018-10-12","runtime":109,"episode_run_time":[109],"vote_average":6.5,"created_by":["Tobis Film","Glory Film","Epo-Film","Perathon Film-und Fernsehproduktions","ORF","ARD Degeto"],"production_companies":[{"name":"Tobis Film"},{"name":"Glory Film"},{"name":"Epo-Film"},{"name":"Perathon Film-und Fernsehproduktions"},{"name":"ORF"},{"name":"ARD Degeto"}],"cast":["Simon Morzé","Bruno Ganz","Johannes Krisch","Emma Nova","Karoline Eichhorn"],"backdrop_path":"https://image.tmdb.org/t/p/original/tUfYCSqZ4efMVd84hEF5Uc2MsBO.jpg","poster_path":"https://image.tmdb.org/t/p/original/w4h717rbBuy78KgxtMKCZThWjF2.jpg","certification":"16","genres":["Drama","História"],"trailer":"kxjaGLXpq70"},
