"40823":{"id":"40823","name":"O Homem Que Copiava","slug":"o-homem-que-copiava","original_title":"O Homem Que Copiava","overview":"André tem 20 anos e trabalha como operador de fotocópias na livraria e papelaria, em Porto Alegre. Mora com a mãe, gosta de desenhar e gosta da Sílvia. Ele precisa desesperadamente de trinta e oito reais. Sílvia tem 18 anos, estuda à noite e trabalha numa boutique. Mora com o pai, gosta de ler e leva uma vida calma. Sílvia tem um encontro marcado no Corcovado a que não pode faltar. Marinês trabalha na papelaria, com André. Namora, mas não muito, com um alemão que vive na Holanda. Marinês gosta de vestir o que não tem dinheiro para comprar. Cardoso faz tudo por ela e Marinês faz quase tudo com ele. Cardoso deixou de fumar há dois dias, a pedido de Marinês. Não sente muito a falta do cigarro, só às vezes depois do almoço.. Quem não fuma não sabe o que significa \"aquele\" cigarro depois da refeição. André precisa de trinta e oito reais para comprar uma camisa de noite e para salvar a vida de Sílvia. André faz muitos planos para conseguir dinheiro. E todos dão certo.","first_air_date":"2003-06-13","runtime":123,"episode_run_time":[123],"vote_average":7.5,"created_by":["Casa de Cinema de Porto Alegre","Globo Filmes"],"production_companies":[{"name":"Casa de Cinema de Porto Alegre"},{"name":"Globo Filmes"}],"cast":["Lázaro Ramos","Leandra Leal","Luana Piovani","Pedro Cardoso","Carlos Cunha Filho"],"backdrop_path":"https://image.tmdb.org/t/p/original/fN4OThflKQ8ZT1w2qRRIJmLejKk.jpg","poster_path":"https://image.tmdb.org/t/p/original/a7cP7NqFuD745Gdw4nKFQMtJ6lZ.jpg","certification":"N/A","genres":["Comédia","Drama","Romance","Crime"],"trailer":"WSV3QQutOG4"},
