"470333":{"id":"470333","name":"Corações Batendo Alto","slug":"coracoes-batendo-alto","original_title":"Hearts Beat Loud","overview":"Frank (Nick Offerman) é um pai solteiro que não está preparado para se despedir de sua filha, que em breve se mudará para seguir seu sonho de estudar medicina. Ele é dono de uma gravadora que está falindo, mas espera manter contato com a filha através da paixão que dividem: a música. Um pouco antes da mudança, Frank sugere que os dois iniciem uma banda, a \"We're Not A Band\". Uma das músicas compostas pela dupla viraliza instantaneamente na internet. Agora, Sam precisa decidir entre cursar a faculdade de medicina, um dos maiores objetivos de sua vida, ou se continua ao lado do pai, se dedicando a banda e a carreira de cantora.","first_air_date":"2018-06-08","runtime":97,"episode_run_time":[97],"vote_average":7.0,"created_by":["Burn Later Productions","Houston King Productions","Park Pictures Features","Stage 6 Films"],"production_companies":[{"name":"Burn Later Productions"},{"name":"Houston King Productions"},{"name":"Park Pictures Features"},{"name":"Stage 6 Films"}],"cast":["Nick Offerman","Kiersey Clemons","Blythe Danner","Toni Collette","Sasha Lane"],"backdrop_path":"https://image.tmdb.org/t/p/original/6XznuR5s363S8ZqrqEFO0qXl7V5.jpg","poster_path":"https://image.tmdb.org/t/p/original/wwC8ssH8Xu0WVkOi2gdTIle3Pa0.jpg","certification":"12","genres":["Música","Drama","Comédia","Família"],"trailer":"LTi8kJDjODE"},
"80384":{"id":"80384","name":"A Saga Molusco: Anoitecer","slug":"a-saga-molusco-anoitecer","original_title":"Breaking Wind","overview":"Sátira da saga \"Crepúsculo\", que mostra Bella, o vampiro branquelo Edward e o lobisomem gorducho Jacob como você nunca viu antes. Bella está às voltas com o aguardado casamento com Edward, uma possível gravidez do primeiro filho e também com as trapalhadas de Jacob, o amigo de todas as horas, mas que não larga do pé dela.\r Equipa Principal","first_air_date":"2012-03-27","runtime":83,"episode_run_time":[83],"vote_average":3.3,"created_by":["Primary Pictures","Thunder Smoke Media"],"production_companies":[{"name":"Primary Pictures"},{"name":"Thunder Smoke Media"}],"cast":["Heather Ann Davis","Eric Callero","Frank Pacheco","Michael Adam Hamilton","Alice Rietveld"],"backdrop_path":"https://image.tmdb.org/t/p/original/y09qA5XU7BxtPGpGFT5KbCumc3O.jpg","poster_path":"https://image.tmdb.org/t/p/original/5zekfCV6FP6eNskwf3TRwcjryNZ.jpg","certification":"N/A","genres":["Comédia","Fantasia"],"trailer":"N/A"},
"9583":{"id":"9583","name":"Divinos Segredos","slug":"divinos-segredos","original_title":"Divine Secrets of the Ya-Ya Sisterhood","overview":"Nova York, Siddalee Walker (Sandra Bullock) é uma teatróloga de sucesso que, ao dar uma entrevista para a revista Time, se abre emocionalmente e relata sua infância sofrida, principalmente por causa de Viviane Abbott (Ellen Burstyn), sua mãe. Ao ler a matéria \"Vivi\" fica muito magoada, pois acha que \"Sidda\" foi injusta. Sentindo que a relação mãe-filha pode entrar em uma crise irreversível, Necie (Shirley Knight), Caro (Maggie Smith) e Teensy (Fionnula Flanagan), um trio de mulheres determinadas que, juntamente com Vivi, formaram há 60 anos um sociedade secreta feminista baseada na amizade, por elas chamada de \"A Irmandade de Ya-Ya\", resolve agir. As três seqüestram Sidda e a levam para sua casa na Louisiana, onde mostram a ela um álbum de recortes cuidadosamente guardado, que retrata o passado doloroso de Vivi, com o objetivo de reaproximar mãe e filha.","first_air_date":"2002-06-07","runtime":117,"episode_run_time":[117],"vote_average":6.1,"created_by":["All Girl Productions","Gaylord Productions"],"production_companies":[{"name":"All Girl Productions"},{"name":"Gaylord Productions"}],"cast":["Sandra Bullock","Ellen Burstyn","Fionnula Flanagan","James Garner","Cherry Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/nTB7rsZ1JTCrolj91bRBFgi9G4x.jpg","poster_path":"https://image.tmdb.org/t/p/original/7TVOq6Av1mlX1sVcVzreW3yfNdN.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"383807":{"id":"383807","name":"Coração e Alma","slug":"coracao-e-alma","original_title":"Réparer les vivants","overview":"Três jovens saem para pegar umas ondas e ver o nascer do sol. No caminho de volta, eles sofrem um grave acidente. Um deles, Simon, é internado em estado grave. Depois de um período, sua morte cerebral é declarada e sua família decide que irá doar seus órgãos. Inicia-se, então, a jornada contra o tempo para transplantar o coração de Simon para uma moça em um hospital de Paris.","first_air_date":"2016-11-01","runtime":103,"episode_run_time":[103],"vote_average":6.5,"created_by":[],"production_companies":[],"cast":["Tahar Rahim","Emmanuelle Seigner","Anne Dorval","Bouli Lanners","Kool Shen"],"backdrop_path":"https://image.tmdb.org/t/p/original/l0PU1wNNa0OesqADtRzxpJ89UXe.jpg","poster_path":"https://image.tmdb.org/t/p/original/hMSejIYRQL4V47mi3BqDaCjjWje.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"569814":{"id":"569814","name":"Mulheres Armadas, Homens na Lata","slug":"mulheres-armadas-homens-na-lata","original_title":"Rebelles","overview":"Unidas pelo assassinato acidental do patrão abusivo, as funcionárias da fábrica de atum enlatado Sandra, Marilyn e Nadine encontram uma mala cheia de dinheiro no corpo do defunto. As três estão desesperadamente precisando de grana, e decidem roubar o dinheiro e se livrar do cadáver, enlatando-o. O que poderia ter sido um plano perfeito, transforma-se em uma terrível confusão, quando os gângsteres donos do dinheiro aparecem, e as latas com os restos mortais vão para uma instituição de caridade.","first_air_date":"2019-01-17","runtime":87,"episode_run_time":[87],"vote_average":6.1,"created_by":["Le Pacte","France 3 Cinéma","Wild Bunch","Canal+","Ciné+","France Télévisions","Albertine Productions"],"production_companies":[{"name":"Le Pacte"},{"name":"France 3 Cinéma"},{"name":"Wild Bunch"},{"name":"Canal+"},{"name":"Ciné+"},{"name":"France Télévisions"},{"name":"Albertine Productions"}],"cast":["Cécile de France","Audrey Lamy","Yolande Moreau","Simon Abkarian","Samuel Jouy"],"backdrop_path":"https://image.tmdb.org/t/p/original/tdINmzvmq0en7FprqiE3STwM9hQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Ds7nxqGBITsW4it1MOJ1sozumg.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
