"503706":{"id":"503706","name":"A Maldição de Sharon Tate","slug":"a-maldicao-de-sharon-tate","original_title":"The Haunting of Sharon Tate","overview":"Sharon Tate estava no melhor momento de sua vida: tinha sido indicada ao Globo de Ouro por sua atuação no filme “O Vale da Bonecas”, era casada com um dos maiores diretores de Hollywood, Roman Polanski, e carregava na barriga seu primeiro filho. Tudo mudou quando seguidores de um culto macabro liderado por Charles Manson invadiram sua casa em Los Angeles e a esfaquearam dezesseis vezes, sem nenhuma piedade. Minutos antes de morrer, Sharon tomou consciência de todas as atrocidades que ela e seu filho estavam prestes a sofrer.","first_air_date":"2019-04-05","runtime":90,"episode_run_time":[90],"vote_average":4.5,"created_by":["Voltage Pictures","ETA films","1428 Films","Green Light Pictures","Skyline Entertainment"],"production_companies":[{"name":"Voltage Pictures"},{"name":"ETA films"},{"name":"1428 Films"},{"name":"Green Light Pictures"},{"name":"Skyline Entertainment"}],"cast":["Hilary Duff","Jonathan Bennett","Lydia Hearst","Pawel Szajda","Ryan Cargill"],"backdrop_path":"https://image.tmdb.org/t/p/original/7OsMTSVI9pfurIsaOrGPW7cxqgk.jpg","poster_path":"https://image.tmdb.org/t/p/original/g6HBnMsznUcAZuGIdAAwlGxfdZF.jpg","certification":"16","genres":["Terror","Thriller"],"trailer":"N/A"},
