"589978":{"id":"589978","name":"A Chance de Fahim","slug":"a-chance-de-fahim","original_title":"Fahim","overview":"Forçado a fugir de sua terra natal, Bangladesh, o jovem Fahim e seu pai deixam o resto da família e partem para Paris. Após a sua chegada à França, eles começam uma verdadeira maratona de obstáculos para obter asilo político. Graças ao seu talento com xadrez, Fahim conhece Sylvain, um dos melhores treinadores da França. Quando o campeonato francês começa, a ameaça de deportação pressiona Fahim e seu pai. O jovem enxadrista tem apenas uma opção para continuar no país: ser campeão. Baseado em fatos reais.","first_air_date":"2019-10-16","runtime":107,"episode_run_time":[107],"vote_average":6.9,"created_by":["Waiting for Cinéma","Wild Bunch","France 3 Cinéma","Delta Cinéma"],"production_companies":[{"name":"Waiting for Cinéma"},{"name":"Wild Bunch"},{"name":"France 3 Cinéma"},{"name":"Delta Cinéma"}],"cast":["Assad Ahmed","Gérard Depardieu","Isabelle Nanty","Minazur Rahaman","Pierre Gommé"],"backdrop_path":"https://image.tmdb.org/t/p/original/aXGKyAbfYRK2LF9ZsdC3Xu0QFJy.jpg","poster_path":"https://image.tmdb.org/t/p/original/lFczgSY9J4bFeBM5GPNl48vu6V2.jpg","certification":"N/A","genres":["Drama","Família","Comédia"],"trailer":"q1ZkCbi_2gQ"},
