"25751":{"id":"25751","name":"Colheita Maldita 5: Campos do Terror","slug":"colheita-maldita-5-campos-do-terror","original_title":"Children of the Corn V: Fields of Terror","overview":"Um grupo de adolescentes se perde no meio dos Estados Unidos e chega a Gatlin, Nebrasca, onde crianças esquecidas tomaram por obrigação servir \"àquele que anda por detrás do milharal\". Os adolescentes têm menos de uma semana para saírem da cidade, todavia eles descobrem que seu carro está destruído e as crianças são incontáveis. Alison, a líder dos adolescentes, escuta que as crianças são adotadas por Lucas Enright, um homem louco que se considera o salvador daquelas crianças, e o representante na Terra daquele que anda por detrás do milharal. Ao lembrar que seu irmão está entre eles, Alison e o resto decidem ir à fazenda de Enright para descobrir a verdade sobre aquele culto bizarro.","first_air_date":"1998-06-21","runtime":83,"episode_run_time":[83],"vote_average":4.0,"created_by":["Dimension Films","Blue Rider Pictures"],"production_companies":[{"name":"Dimension Films"},{"name":"Blue Rider Pictures"}],"cast":["Stacy Galina","Alexis Arquette","Eva Mendes","Greg Vaughan","Angela Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/vq6FaBz3VsiwwfVDzGrffobBHwW.jpg","poster_path":"https://image.tmdb.org/t/p/original/3MgNa8JE739eiasSOifeoKts2G4.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
