"31593":{"id":"31593","name":"Obstinação","slug":"obstinacao","original_title":"Cutter's Way","overview":"Em uma noite chuvosa, o carro de Richard Bone (Bridges) quebra em um beco, ele então vê um carro misterioso surgir e um homem despeja algo em uma lata de lixo. No começo, Bone não pensa sobre o ocorrido e vai se encontrar com o seu amigo, Alex Cutter (Heard). No dia seguinte, uma jovem garota é encontrada brutalmente assassinada no mesmo beco onde Bone abandonou seu carro e torna-se o principal suspeito do crime. Bone vê o homem que acha que é o assassino em uma parada mais tarde naquele dia - o magnata local JJ Cord (Stephen Elliott) - Cutter começa a ter um interesse no mistério que se desenrola. Seu interesse logo se torna uma teoria da conspiração que se desenvolve em uma investigação incômoda com seu amigo cético e a irmã da garota morta (Ann Dusenberry).","first_air_date":"1981-03-19","runtime":105,"episode_run_time":[105],"vote_average":6.4,"created_by":["United Artists","Gurian Entertainment"],"production_companies":[{"name":"United Artists"},{"name":"Gurian Entertainment"}],"cast":["Jeff Bridges","John Heard","Lisa Eichhorn","Stephen Elliott","Arthur Rosenberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/6BW5JJ9XMXfbG5x4gTuv6MGrKlN.jpg","poster_path":"https://image.tmdb.org/t/p/original/4Qsy3teeaBv3uH3vCVZPkbhyYih.jpg","certification":"N/A","genres":["Drama","Mistério","Thriller","Crime"],"trailer":"N/A"},
