"271714":{"id":"271714","name":"The Beach Boys: Uma História de Sucesso","slug":"the-beach-boys-uma-historia-de-sucesso","original_title":"Love & Mercy","overview":"Brian Wilson fundou os Beach Boys, uma das bandas mais populares do Estados Unidos nos anos 1960. A trama foca a degeneração mental de Wilson e os problemas que seus diversos tratamentos trouxeram ao grupo, resultando em sua saída da banda. O filme também mostrará a relação de Wilson com sua esposa Melinda e como o astro foi manipulado pelo Dr. Eugene Landy.","first_air_date":"2015-05-29","runtime":121,"episode_run_time":[121],"vote_average":7.1,"created_by":["John Wells Productions","River Road Entertainment","Battle Mountain Films"],"production_companies":[{"name":"John Wells Productions"},{"name":"River Road Entertainment"},{"name":"Battle Mountain Films"}],"cast":["Paul Dano","John Cusack","Elizabeth Banks","Paul Giamatti","Jake Abel"],"backdrop_path":"https://image.tmdb.org/t/p/original/l19ruhwCLotkG5wTcelrqVvmPX8.jpg","poster_path":"https://image.tmdb.org/t/p/original/9kolGjaLwnZJGoHlS8tdeZnG6Z0.jpg","certification":"14","genres":["Drama","Música","História"],"trailer":"N/A"},
