"611291":{"id":"611291","name":"BTS: Bring The Soul - O Filme","slug":"bts-bring-the-soul-o-filme","original_title":"브링 더 소울: 더 무비","overview":"Depois da inesquecível turnê `Love Yourself´, o BTS retorna de modo triunfal às telas dos cinemas com BRING THE SOUL; THE MOVIE. Brilhando ainda mais que as luzes do palco, o grupo agora nos convida para os bastidores. No dia seguinte ao concerto final da turnê do grupo na Europa, em cima de um telhado em Paris, o BTS conta suas próprias histórias, desde a experiência de conhecer novas cidades até apresentações para milhares de fãs (que o grupo prefere chamar de ARMY) em todo o mundo. Uma visita ao mundo do BTS fora do palco, com conversas intimistas do grupo acompanhadas de apresentações espetaculares nos shows da turnê, esse é um evento cinematográfico imperdível. A jornada do BTS continua!","first_air_date":"2019-08-07","runtime":105,"episode_run_time":[105],"vote_average":8.4,"created_by":["Big Hit Entertainment","The Walt Disney Company Korea"],"production_companies":[{"name":"Big Hit Entertainment"},{"name":"The Walt Disney Company Korea"}],"cast":["RM","진","슈가","제이홉","지민"],"backdrop_path":"https://image.tmdb.org/t/p/original/nQRTynJcXF5GRcyEHF09yZIuQ7F.jpg","poster_path":"https://image.tmdb.org/t/p/original/uQI0fm8uPild3U5spX0I6MapSHB.jpg","certification":"N/A","genres":["Música","Documentário"],"trailer":"q0h7NCYPxP4"},
