"28966":{"id":"28966","name":"Asas","slug":"asas","original_title":"Wings","overview":"Jack trabalha com seu carro esporte e sonha voar. Sua vizinha Mary está apaixonada por ele, mas ele não parece estar interessado nela. Jack está aos encantos de Sylvia, mas não tem chances com ela porque Sylvia só tem olhos para David. Quando a guerra começa a ecoar, Jack e David são treinados para serem pilotos. Sua rivalidade logo se transforma em amizade, ao decorrer do tempo que eles lutam contra os alemães no céu da França.","first_air_date":"1927-08-12","runtime":135,"episode_run_time":[135],"vote_average":7.2,"created_by":["Paramount Famous Lasky Corporation"],"production_companies":[{"name":"Paramount Famous Lasky Corporation"}],"cast":["Clara Bow","Charles \"Buddy\" Rogers","Richard Arlen","Jobyna Ralston","El Brendel"],"backdrop_path":"https://image.tmdb.org/t/p/original/u90ajspDd9911ISbx74rtofQZfO.jpg","poster_path":"https://image.tmdb.org/t/p/original/7FTi4hrKP4RRCylKdbirxhk7G5o.jpg","certification":"N/A","genres":["Drama","Ação","Guerra","Romance"],"trailer":"N/A"},
"100683":{"id":"100683","name":"Olhos de Dragão","slug":"olhos-de-dragao","original_title":"Dragon Eyes","overview":"No bairro de St. Jude Square, em Nova Orleans, uma guerra entre duas gangues está tirando a paz dos moradores da região. Os líderes opostos Dash e Antuan criam o pânico nas ruas e a esperança parece ter terminado para aquele pedaço da cidade. Isso muda quando Ryan Hong chega à cidade. Um a um, Ryan vai demolindo todos os líderes do tráfico e pequenos mafiosos, fazendo uma verdadeira limpeza no bairro.","first_air_date":"2012-05-10","runtime":88,"episode_run_time":[88],"vote_average":5.2,"created_by":["Silver Pictures","Signature Pictures","After Dark Films","Autonomous Films","Signature Entertainment"],"production_companies":[{"name":"Silver Pictures"},{"name":"Signature Pictures"},{"name":"After Dark Films"},{"name":"Autonomous Films"},{"name":"Signature Entertainment"}],"cast":["Jean-Claude Van Damme","Peter Weller","Cung Le","Luis Da Silva, Jr.","Crystal Mantecon"],"backdrop_path":"https://image.tmdb.org/t/p/original/3BmQJjDUGoVuBrYoqLfCWr2pF01.jpg","poster_path":"https://image.tmdb.org/t/p/original/iOU8xDtY4dcuPnvsefWcuiPoTNn.jpg","certification":"N/A","genres":["Ação"],"trailer":"xLkzGhZoiPY"},
