"519176":{"id":"519176","name":"Gintama 2: Quebrando As Regras","slug":"gintama-2-quebrando-as-regras","original_title":"銀魂2 掟は破るためにこそある","overview":"Hijikata Toushirou, o temido vice-comandante demoníaco do Shinsengumi, sofre um ataque misterioso que muda completamente a sua personalidade, transformando-o em um otaku medroso intitulado “Tosshi”. Enquanto Hijikata luta para recuperar sua antiga personalidade, o Shinsengumi ganha mais um membro: Itou Kamotarou, que se aproveita da nova personalidade do Hijikata para tentar tomar o Shinsengumi. No entanto, os planos de Itou se mostram tortuosos, e a existência do Shinsengumi é colocada em xeque.","first_air_date":"2018-08-04","runtime":134,"episode_run_time":[134],"vote_average":7.1,"created_by":["Warner Bros. Japan"],"production_companies":[{"name":"Warner Bros. Japan"}],"cast":["小栗旬","菅田将暉","橋本環奈","長澤まさみ","岡田将生"],"backdrop_path":"https://image.tmdb.org/t/p/original/qZkJFagYiIIsZNXhMCMGKMsb0p4.jpg","poster_path":"https://image.tmdb.org/t/p/original/3wSD4S4LF9BR7rq6dL966fJIvAe.jpg","certification":"N/A","genres":["Comédia","Ação","Ficção científica","Fantasia"],"trailer":"N/A"},
