"14172":{"id":"14172","name":"Vingança","slug":"vinganca","original_title":"Wake of Death","overview":"Ben Archer volta para Los Angeles depois de um trabalho feito para a máfia. Ele está cansado e quer se aposentar. Certa noite, durante uma ação, ela encontra uma garotinha, Kim, entre os imigrantes e sente pena dela. Cynthia convece seu chefe, o detetive Mac Hoggins, a deixar Kim ir para sua casa passar a noite. A garotinha é filha de Sun Quan, o temido chefe da Tríade Chinesa. O homem que Kim viu matar sua mãe e do qual ela está fugindo. Com ajuda de Hoggins, Quan descobre que Kim está com Cynthia. No dia seguinte, enquanto Ben está trabalhando, sua família é brutalmente assassinada por Sun Quan e seus homens. Apenas Kim e Nicholas conseguem sobreviver. Quando Ben chega ao local vê os homens armados indo embora junto com Andy Wang, um traficante sócio de Sun Quan. Depois de um tiroteio, Ben encontra sua esposa morta. Ele fica inconsolável diante de sua morte. Eles mataram a mulher do cara errado...","first_air_date":"2004-12-28","runtime":91,"episode_run_time":[91],"vote_average":6.0,"created_by":["Bauer Martinez Studios","UKFS","Frame Werk Produktion GmbH & Co. KG","The Tower Limited Liability Partnership","Lucky 7 Productions","Blue Rider Pictures","LMCP Films","Royal Bank of Scotland","Sagewise"],"production_companies":[{"name":"Bauer Martinez Studios"},{"name":"UKFS"},{"name":"Frame Werk Produktion GmbH & Co. KG"},{"name":"The Tower Limited Liability Partnership"},{"name":"Lucky 7 Productions"},{"name":"Blue Rider Pictures"},{"name":"LMCP Films"},{"name":"Royal Bank of Scotland"},{"name":"Sagewise"}],"cast":["Jean-Claude Van Damme","任達華","Valerie Tian","Philip Tan","Tony Schiena"],"backdrop_path":"https://image.tmdb.org/t/p/original/pdd21d0dgFC4rImh4WCOaECiJmA.jpg","poster_path":"https://image.tmdb.org/t/p/original/9WF1TawdMN041VwOMRa30YvqO0E.jpg","certification":"N/A","genres":["Ação"],"trailer":"N/A"},
"52696":{"id":"52696","name":"Band Baaja Baaraat","slug":"band-baaja-baaraat","original_title":"Band Baaja Baaraat","overview":"Shruti é uma menina de 20 anos de classe média de Delhi. Focada e determinada com ambições planejadas com antecedência, seus objetivos na vida são definidos no momento que ela chega a seu último ano de faculdade. Bittoo, por outro lado, não tem nenhum objetivo na vida. Como um estudante do último ano da faculdade de Delhi, ele passa sua vida se divertindo com seus amigos, mal passando em seus exames. Uma possibilidade e uma reunião inoportuna reúne os dois numa viagem tumultuada onde eles se tornam parceiros no seu negócio,\"Planejadores de Casamento\". As regras no entanto, são claras: \"Não misture negócios com prazer\". Juntos, a sua amizade e os negócios, entre os altos e baixos dos casamentos pródigos de Delhi e tentando encontrar-se, Shruti e Bittoo descobrem um ao outro e percebem no curso da sua viagem, que o amor não tem regras.","first_air_date":"2010-12-10","runtime":139,"episode_run_time":[139],"vote_average":6.6,"created_by":["Yash Raj Films"],"production_companies":[{"name":"Yash Raj Films"}],"cast":["Ranveer Singh","Anushka Sharma","Manmeet Singh","Manu Rishi Chadha","Manish Chaudhary"],"backdrop_path":"https://image.tmdb.org/t/p/original/lmOFoZBxTEwc75N1TN91kqdAzxY.jpg","poster_path":"https://image.tmdb.org/t/p/original/n9Yd0otyugR9ArGxRwbEYxUXjTH.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
