"9786":{"id":"9786","name":"Uma Escola de Arte Muito Louca","slug":"uma-escola-de-arte-muito-louca","original_title":"Art School Confidential","overview":"Filme que foca a trajetória de um jovem e talentoso artista que resolve abandonar o colégio e ingressar em uma pequena escola de arte na costa leste. Tendo como ídolo o pintor Picasso, o garoto sonha em se tornar o maior artista do mundo, porém ele encontra problemas quando seus trabalhos não têm o grau de aceitação que ele imaginava durante as aulas de arte. A isso, soma-se o fato dele sempre fazer duras críticas aos trabalhos de seus colegas, e sua procura intensa por uma arte original. Contudo, ele atrai a atenção de uma linda garota, que é modelo de um artista e filha de um outro, que é bastante consagrado. Ela se encanta com a sinceridade do garoto, mas logo um outro pintor chama a sua atenção. Depois de perder a garota, o jovem artista planeja um golpe arriscado para se tornar um grande pintor e recuperar sua amada.","first_air_date":"2006-05-05","runtime":102,"episode_run_time":[102],"vote_average":6.1,"created_by":["Mr. Mudd"],"production_companies":[{"name":"Mr. Mudd"}],"cast":["Max Minghella","Sophia Myles","John Malkovich","Jim Broadbent","Matt Keeslar"],"backdrop_path":"https://image.tmdb.org/t/p/original/yDgMI5clt1rQwvsdcM16UJ5yz3j.jpg","poster_path":"https://image.tmdb.org/t/p/original/eV6UL22Zlpsq5XybUupWh0rBOp0.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
