"660000":{"id":"660000","name":"Ilusões Perdidas","slug":"ilusoes-perdidas","original_title":"Illusions perdues","overview":"Lucien é um jovem poeta desconhecido da França do século XIX. Ele tem grandes esperanças e quer escolher seu destino. Ele larga a gráfica de sua província natal para tentar a sorte em Paris, nos braços de sua protetora. Logo deixado por conta própria na fabulosa vila, o jovem rapaz vai descobrir os bastidores de um mundo condenado à lei do lucro e das falsidades. Uma comédia humana na qual tudo se compra e se vende, da literatura à imprensa, da política aos sentimentos, das reputações às almas. Ele vai amar, sofrer, e sobreviver às suas ilusões.","first_air_date":"2021-10-20","runtime":149,"episode_run_time":[149],"vote_average":7.4,"created_by":["Curiosa Films","France 3 Cinéma","Pictanovo","uMedia","Canal+","France Télévisions","Ciné+","CNC","Orange Studio","Gaumont","Gabriel Inc.","uFund","Région Hauts-de-France"],"production_companies":[{"name":"Curiosa Films"},{"name":"France 3 Cinéma"},{"name":"Pictanovo"},{"name":"uMedia"},{"name":"Canal+"},{"name":"France Télévisions"},{"name":"Ciné+"},{"name":"CNC"},{"name":"Orange Studio"},{"name":"Gaumont"},{"name":"Gabriel Inc."},{"name":"uFund"},{"name":"Région Hauts-de-France"}],"cast":["Benjamin Voisin","Cécile de France","Vincent Lacoste","Xavier Dolan","Salomé Dewaels"],"backdrop_path":"https://image.tmdb.org/t/p/original/snZCW8qyOmH2jYwCR6DRrm64Kwf.jpg","poster_path":"https://image.tmdb.org/t/p/original/6ovwvY0NajegyC2xtwxD9GEhdFp.jpg","certification":"16","genres":["Drama","Romance","História"],"trailer":"D3SG2mT8BcI"},
