"15745":{"id":"15745","name":"Crime Desorganizado","slug":"crime-desorganizado","original_title":"Made","overview":"Bobby Ricigliano (Jon Favreau) é pugilista e também segurança de sua namorada, que trabalha como stripper. Ele odeia seu trabalho e sonha com o dia em que poderá largar tudo. Quando surge a oportunidade Bobby não pensa duas vezes e segue com seu chefe para Nova York, para ajudá-lo em um negócio. Ricky Slade (Vince Vaughn), o melhor amigo de Bobby e fanático por filmes de mafiosos, o acompanha nesta empreitada. Ao chegar à cidade a dupla decide ignorar as instruções que receberam e decidem frequentar todas as boates e bares que puderem.","first_air_date":"2001-07-13","runtime":95,"episode_run_time":[95],"vote_average":5.8,"created_by":["Artisan Entertainment","Cardiff Giant Productions","Resnick Interactive Development"],"production_companies":[{"name":"Artisan Entertainment"},{"name":"Cardiff Giant Productions"},{"name":"Resnick Interactive Development"}],"cast":["Vince Vaughn","Jon Favreau","Sean Combs","Famke Janssen","Peter Falk"],"backdrop_path":"https://image.tmdb.org/t/p/original/bfrkFpsNYRkzVTf1arVn6w2Kphe.jpg","poster_path":"https://image.tmdb.org/t/p/original/4HC6ieptXO2gjqbSEsfkOwsGubN.jpg","certification":"N/A","genres":["Comédia","Crime","Drama"],"trailer":"N/A"},
