"42418":{"id":"42418","name":"O Jovem Corcel Negro","slug":"o-jovem-corcel-negro","original_title":"Young Black Stallion","overview":"Neera (Biana Tamimi) é uma menina árabe que foi separada do seu pai na sua terra natal durante a Segunda Guerra Mundial. Deixada sozinha no deserto, acaba fazendo amizade com um potro negro, ao qual ela dá o nome de Sheetan. Porém, com o passar do tempo ela reencontra o pai e é obrigada a abandonar seu amigo de equino. Mas não será fácil esquece-lo, e ela é perseguida pela imagem do animal perdido no deserto o tempo todo. Mais tarde ela descobre se tratar de uma lenda sobre um corcel nascido das areias do deserto.","first_air_date":"2003-12-25","runtime":49,"episode_run_time":[49],"vote_average":6.6,"created_by":["FR Productions","The Kennedy/Marshall Company"],"production_companies":[{"name":"FR Productions"},{"name":"The Kennedy/Marshall Company"}],"cast":["Biana Tamimi","Richard Romanus","Patrick Elias","Gérard Rudolf","Ali Al Ameri"],"backdrop_path":"https://image.tmdb.org/t/p/original/jHaBtSr3g1RaHeyK4v3sFRmXh2C.jpg","poster_path":"https://image.tmdb.org/t/p/original/adCZqppp9nZxOHfaOhujqFRenIe.jpg","certification":"N/A","genres":["Aventura","Drama","Família"],"trailer":"N/A"},
"1249":{"id":"1249","name":"Hollywoodland: Bastidores da Fama","slug":"hollywoodland-bastidores-da-fama","original_title":"Hollywoodland","overview":"16 de junho de 1959. O ator George Reeves (Ben Affleck), mais conhecido como o protagonista da série de TV \"As Aventuras do Super-Homem\", comete suicídio. O ato ocorreu no quarto de Reeves, deixando sua namorada, a aspirante a atriz Leonore Lemmon (Robin Tunney), e milhões de jovens fãs boquiabertos. Helen Bessolo (Lois Smith), a mãe de Reeves, não se conforma com a possibilidade de que seu filho tenha se suicidado e contrata o detetive Louis Simo (Adrien Brody), que tem por missão provar que o caso na verdade foi de assassinato. Simo passa a investigar Reeves, descobrindo seu antigo caso com Toni Mannix (Diane Lane), esposa de um poderoso executivo do estúdio MGM.","first_air_date":"2006-08-31","runtime":126,"episode_run_time":[126],"vote_average":6.1,"created_by":["Focus Features","Miramax","Back Lot Pictures"],"production_companies":[{"name":"Focus Features"},{"name":"Miramax"},{"name":"Back Lot Pictures"}],"cast":["Adrien Brody","Diane Lane","Ben Affleck","Bob Hoskins","Robin Tunney"],"backdrop_path":"https://image.tmdb.org/t/p/original/grBVNhFI7iNB54eFfXVzbYfDSQk.jpg","poster_path":"https://image.tmdb.org/t/p/original/tSrEs5xhz3M5lCcwfiSsNiMU1Zq.jpg","certification":"N/A","genres":["Crime","Drama","Mistério","Thriller"],"trailer":"N/A"},
