"28503":{"id":"28503","name":"Demência 13","slug":"demencia-13","original_title":"Dementia 13","overview":"Quando seu marido, John, sofre um ataque cardíaco em um barco a remo no lago, Louise Haloran joga seu corpo ao mar e depois diz à família que ele partiu em uma viagem de negócios urgente. Sua principal preocupação é que ela só pode herdar uma parte da fortuna da família se o marido estiver vivo. Os haloranos são uma família estranha, ainda sofrendo com a morte da filha mais nova Kathleen, que se afogou em um lago quando era criança. Eles realizam uma cerimônia anual de lembrança todos os anos no aniversário de sua morte. Este ano, no entanto, alguém está usando um machado com intenção de matar.","first_air_date":"1963-09-25","runtime":75,"episode_run_time":[75],"vote_average":5.5,"created_by":["The Filmgroup","Roger Corman Productions","American International Pictures"],"production_companies":[{"name":"The Filmgroup"},{"name":"Roger Corman Productions"},{"name":"American International Pictures"}],"cast":["William Campbell","Luana Anders","Bart Patton","Mary Mitchel","Patrick Magee"],"backdrop_path":"https://image.tmdb.org/t/p/original/z2ZiFPibdguCYJBN9rZeHCMHxcO.jpg","poster_path":"https://image.tmdb.org/t/p/original/szEncXgg2YsuY4mltOX50xJnbFs.jpg","certification":"N/A","genres":["Terror","Mistério","Thriller"],"trailer":"N/A"},
