"17889":{"id":"17889","name":"Marujos do Amor","slug":"marujos-do-amor","original_title":"Anchors Aweigh","overview":"Dois marinheiros, um ingênuo, e outro experimentado nos caminhos da vida, em liberdade, e em Los Angeles, é o cenário para este filme musical. E encontram uma simpática garota que tem uma bela voz. E também tem um filho, um garoto de 7 anos, que é um verdadeiro fanatico pela marinha. E para emoldurar tudo o grande maestro José Iturbi. Nas ondas da música... Risos e Romance! Dois marinheiros perdidos de amor em uma licença de quatro dias de diversão e frivolidade!","first_air_date":"1945-08-13","runtime":143,"episode_run_time":[143],"vote_average":6.8,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Frank Sinatra","Kathryn Grayson","Gene Kelly","José Iturbi","Dean Stockwell"],"backdrop_path":"https://image.tmdb.org/t/p/original/oRw716yj4jgshktF03s2is7HGun.jpg","poster_path":"https://image.tmdb.org/t/p/original/uiQAZQvuZqckowOIAQyI2RybXAf.jpg","certification":"10 anos","genres":["Música","Comédia","Romance"],"trailer":"N/A"},
