"1967":{"id":"1967","name":"Pergunte ao Pó","slug":"pergunte-ao-po","original_title":"Ask the Dust","overview":"Los Angeles, década de 30. No auge da depressão, Arturo Bandini (Colin Farrell) sonha se tornar um escritor famoso. Na tentativa de escrever algo ele se hospeda em um quarto barato de hotel, mas logo o plano se mostra um fracasso: o dinheiro de Arturo está acabando e ele ainda não conseguiu escrever. É quando ele conhece Camilla Lopez (Salma Hayek), uma garçonete mexicana que sonha conseguir um bom marido e deixar o emprego. Juntos eles vivem uma relação conturbada, baseada em desejo, ciúmes e desprezo.","first_air_date":"2006-02-02","runtime":116,"episode_run_time":[116],"vote_average":5.4,"created_by":["Cruise/Wagner Productions","Ascendant Pictures","Capitol Films","Noble House Entertainment Pictures","VIP Medienfonds 3"],"production_companies":[{"name":"Cruise/Wagner Productions"},{"name":"Ascendant Pictures"},{"name":"Capitol Films"},{"name":"Noble House Entertainment Pictures"},{"name":"VIP Medienfonds 3"}],"cast":["Colin Farrell","Salma Hayek Pinault","Donald Sutherland","Eileen Atkins","Idina Menzel"],"backdrop_path":"https://image.tmdb.org/t/p/original/qykc21PjbISZCmpKedY76fojV1I.jpg","poster_path":"https://image.tmdb.org/t/p/original/25Jwr51Fg46s9PMloa0Kdo0lgXr.jpg","certification":"N/A","genres":["Romance","Drama"],"trailer":"ADrwaM4vlcU"},
"650272":{"id":"650272","name":"Acima da Lei","slug":"acima-da-lei","original_title":"Beyond the Law","overview":"Steven Seagal, DMX e Johnny Messner estrelam este filme cheio de ação sobre a busca de um homem por justiça em uma cidade corrupta. Quando um ex-detetive fica sabendo do assassinato de seu filho distante, ele se aventura de volta às ruas escuras que ele conhecia tão bem. Armado, perigoso e sem nada a perder, ele deve enfrentar a implacável multidão local em sua missão de vingança.","first_air_date":"2019-12-06","runtime":89,"episode_run_time":[89],"vote_average":5.2,"created_by":["UFO Pictures","Scotty Gelt","BondIt"],"production_companies":[{"name":"UFO Pictures"},{"name":"Scotty Gelt"},{"name":"BondIt"}],"cast":["Steven Seagal","Johnny Messner","DMX","Bill Cobbs","Zack Ward"],"backdrop_path":"https://image.tmdb.org/t/p/original/AopMTry2Pt1nyQGRv7gGlmPQeiu.jpg","poster_path":"https://image.tmdb.org/t/p/original/4d1pvFqLEBpqz83eyzBeDno6YZc.jpg","certification":"N/A","genres":["Ação"],"trailer":"wDoUzta59XU"},
