"46138":{"id":"46138","name":"Revolução em Dagenham","slug":"revolucao-em-dagenham","original_title":"Made in Dagenham","overview":"As operárias da fábrica da Ford de Dagenham vivenciam uma rotina desgastante de trabalho, atrelada a condições precárias e longas jornadas. O basta vem em 1968 quando são classificadas como não qualificadas. Motivadas por Rita O’Grady, as mulheres passam a reivindicar a igualdade de direitos em relação aos salários e o fim da discriminação sexual. Inicialmente direcionada aos patrões, a manifestação se volta contra o governo em uma luta que foi fundamental para que o parlamento britânico consolidasse o Projeto de Paridade Salarial em 1970.","first_air_date":"2010-10-01","runtime":1,"episode_run_time":[1],"vote_average":6.7,"created_by":["Audley Films LLP","BBC Film","BMS Finance","HanWay Films","Lipsync Productions","Number 9 Films","UK Film Council"],"production_companies":[{"name":"Audley Films LLP"},{"name":"BBC Film"},{"name":"BMS Finance"},{"name":"HanWay Films"},{"name":"Lipsync Productions"},{"name":"Number 9 Films"},{"name":"UK Film Council"}],"cast":["Sally Hawkins","Bob Hoskins","Miranda Richardson","Geraldine James","Rosamund Pike"],"backdrop_path":"https://image.tmdb.org/t/p/original/rQvPdR775LuasXP822NNC9cxnJ2.jpg","poster_path":"https://image.tmdb.org/t/p/original/4JMDUoApcRDINyeblreEGrjBtE2.jpg","certification":"N/A","genres":["Comédia","Drama","História"],"trailer":"N/A"},
