"423333":{"id":"423333","name":"O Peso da Dor","slug":"o-peso-da-dor","original_title":"Mass","overview":"Mass é um longa que mostra dois casais e pais em luto que, apesar de ocuparem posições distintas, lidam com uma mesma tragédia em comum, envolvendo seus filhos. Jay e Gail Perry são pais de luto pela morte de seu filho, vítima de um tiroteio na escola. Richard e Linda são os pais do agressor. Seis anos após a tragédia indescritível que destruiu suas vidas, os dois casais concordam em se encontrar e conversar em particular na tentativa de seguir em frente. Todos vivenciam sua jornada de dor, raiva e aceitação, ao ficarem cara a cara.","first_air_date":"2021-10-08","runtime":111,"episode_run_time":[111],"vote_average":7.5,"created_by":["7 Eccles Street","Circa 1888","5B Productions"],"production_companies":[{"name":"7 Eccles Street"},{"name":"Circa 1888"},{"name":"5B Productions"}],"cast":["Martha Plimpton","Jason Isaacs","Ann Dowd","Reed Birney","Breeda Wool"],"backdrop_path":"https://image.tmdb.org/t/p/original/cv6Nn8Yt9mgFoUSievEdW9JK82A.jpg","poster_path":"https://image.tmdb.org/t/p/original/je0qIjmoEYmizlWtDEDTWcdHyRq.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"1873":{"id":"1873","name":"Muito Além De Rangum","slug":"muito-alem-de-rangum","original_title":"Beyond Rangoon","overview":"Quando a doutora Laura Bowman chega em Burma, logo após uma devastadora tragédia pessoal, ela rapidamente é arrastada para uma nova onda de tristeza: a crise governamental de 1988 detonada em pleno movimento pró-democracia. Presa pela turbulência que a cerca e impedida de deixar o país ao lado de seus amigos após a perda de seu passaporte, ela é compelida a rumar para a segurança da Tailândia através da selva. É uma jornada de terror e de esperança para todos aqueles que a acompanham. Para Laura, é também uma jornada de descoberta. Ajudando os outros, ela encontra a redenção para seus próprios males.","first_air_date":"1995-08-25","runtime":100,"episode_run_time":[100],"vote_average":6.6,"created_by":["Castle Rock Entertainment","Pleskow/Spikings Productions"],"production_companies":[{"name":"Castle Rock Entertainment"},{"name":"Pleskow/Spikings Productions"}],"cast":["Patricia Arquette","U Aung Ko","Frances McDormand","Spalding Gray","Tiara Jacquelina"],"backdrop_path":"https://image.tmdb.org/t/p/original/dcGsNJtwBXnXmSqze0289IjScTR.jpg","poster_path":"https://image.tmdb.org/t/p/original/8LlFPQd2nC8TPZ7k34bOEWe7R61.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
