"160068":{"id":"160068","name":"Gloria","slug":"gloria","original_title":"Gloria","overview":"Gloria é uma divorciada de 58 anos. Seus filhos saí­ram de casa, mas ela não tem vontade de passar seus dias e noites sozinha. Determinada a desafiar a velhice e a solidão, ela entra de cabeça em um turbilhão de festas para solteiros em busca de gratificação instantânea – que só leva repetidamente para decepções e vazio. Mas então ela conhece Rodolfo, um ex-oficial naval sete anos mais velho que ela, a quem se sente romanticamente inclinada. Glora até começa a imaginar uma relação permanente entre os dois. No entanto, o encontro apresenta desafios inesperados e Gloria gradualmente se encontra sendo forçada a confrontar seus próprios segredos obscuros.","first_air_date":"2013-02-10","runtime":110,"episode_run_time":[110],"vote_average":6.7,"created_by":["Nephilim Producciones","Forastero"],"production_companies":[{"name":"Nephilim Producciones"},{"name":"Forastero"}],"cast":["Paulina García","Sergio Hernández","Coca Guazzini","Antonia Santa María","Diego Fontecilla"],"backdrop_path":"https://image.tmdb.org/t/p/original/xqc5l6CCOBqni0gT9J2nvodhCD.jpg","poster_path":"https://image.tmdb.org/t/p/original/mCEhoJkqLPKueGPqNLTYEG1pWHY.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
