"48572":{"id":"48572","name":"Seita Mortal","slug":"seita-mortal","original_title":"Red State","overview":"Após receberem um convite online para transar com uma mulher misteriosa (Melissa Leo) trés adolescentes seguem para a cidade de Cooper's Dell. Mas ao invés de aproveitar a noite de seus sonhos, os adolescentes imergem no mundo horripilante de Abin Cooper (Michael Parks), um pastor fundamentalista com convicções mortais. Enquanto os jovens sofrem terrores impensáveis dentro do complexo do pastor, uma força-tarefa militar é mobilizada. Com Cooper's Dell vacilando entre a salvação e a condenação, o líder da força-tarefa (John Goodman) prepara-se para a furiosa batalha com Cooper e seus seguidores fortemente armados.","first_air_date":"2011-08-19","runtime":88,"episode_run_time":[88],"vote_average":6.1,"created_by":["SModcast Pictures","NVSH Productions","Phase 4 Films","View Askew Productions"],"production_companies":[{"name":"SModcast Pictures"},{"name":"NVSH Productions"},{"name":"Phase 4 Films"},{"name":"View Askew Productions"}],"cast":["Michael Parks","John Goodman","Melissa Leo","Michael Angarano","Kyle Gallner"],"backdrop_path":"https://image.tmdb.org/t/p/original/kEr29qsdYt5FQ2sBORL9DBgGrJw.jpg","poster_path":"https://image.tmdb.org/t/p/original/JA3Nx4m7dbO1QwRBhYydq9F42d.jpg","certification":"N/A","genres":["Terror","Ação","Thriller"],"trailer":"N/A"},
"639247":{"id":"639247","name":"Apanhador de Pesadelos","slug":"apanhador-de-pesadelos","original_title":"Dreamkatcher","overview":"Neste aterrorizante thriller de terror, Gail (Radha Mitchell, Silent Hill) é forçada a entrar em acordo com Josh, seu novo enteado, em uma remota casa de campo. Depois de roubar um talismã maligno de um vizinho misterioso, Josh tem sonhos sinistros de sua mãe morta – que ordena que Josh assassine Gail. Quando o pai de Josh (Henry Thomas, “A Assombração da Casa da Colina”) retorna, ele e Gail suspeitam que seu filho tenha sido possuído por um espírito antigo e sedento de sangue. É tarde demais para salvar a vida de Josh – ou a deles?","first_air_date":"2020-06-24","runtime":85,"episode_run_time":[85],"vote_average":5.1,"created_by":["Taylor Lane Productions"],"production_companies":[{"name":"Taylor Lane Productions"}],"cast":["Radha Mitchell","Henry Thomas","Lin Shaye","Finlay Wojtak-Hissong","Jules Willcox"],"backdrop_path":"https://image.tmdb.org/t/p/original/8Muyk9qcGxdMgQXxsBWMGlu7WIy.jpg","poster_path":"https://image.tmdb.org/t/p/original/lEPlsJ8Tko01i1LLBSehVYJcWWU.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
