"26719":{"id":"26719","name":"Jogo de Emoções","slug":"jogo-de-emocoes","original_title":"House of Games","overview":"Uma psiquiatra tenta ajudar um jogador compulsivo e é levada por um golpista de fala suave para o mundo sombrio, mas convincente de golpistas, trambiqueiros e vigaristas. Uma psicóloga famosa, Margaret Ford, decide tentar ajudar um de seus pacientes a se livrar de uma dívida de jogo. Ela visita o bar onde Mike, o dono da dívida, patrocina jogos de poker. Ele a convence a ajudá-lo em um jogo: sua tarefa é olhar para \"sinais\", ou pistas de linguagem corporal. O que parece fácil para ela se torna muito mais complexo.","first_air_date":"1987-10-11","runtime":102,"episode_run_time":[102],"vote_average":6.8,"created_by":["Filmhaus"],"production_companies":[{"name":"Filmhaus"}],"cast":["Lindsay Crouse","Joe Mantegna","Mike Nussbaum","Lilia Skala","J. T. Walsh"],"backdrop_path":"https://image.tmdb.org/t/p/original/fPZIQ0l7zCvQQqpYXVeFvjcyGpj.jpg","poster_path":"https://image.tmdb.org/t/p/original/kP3RVWf4N9WR2BLsiW1PkDvnQaV.jpg","certification":"e 14","genres":["Crime","Thriller","Drama"],"trailer":"N/A"},
"13955":{"id":"13955","name":"Beethoven: A Corrida Para a Fama","slug":"beethoven-a-corrida-para-a-fama","original_title":"Beethoven's Big Break","overview":"Eddie (Jonathan Silverman), um esforçado treinador de animais e pai solteiro, levava uma vida simples e pacata, até o dia em que um de seus cães, um gigante e amável São Bernardo, repentinamente alcança o estrelato e muda para sempre a rotina de todos a sua volta. O treinador adora o sabor do sucesso, mas sua alegria dura pouco. Um trio de inescrupulosos malfeitores planeja sequestrar o cão e cobrar uma fortuna de resgate.","first_air_date":"2008-11-30","runtime":101,"episode_run_time":[101],"vote_average":5.2,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Jonathan Silverman","Moisés Arias","Rhea Perlman","Stephen Tobolowsky","Eddie Griffin"],"backdrop_path":"https://image.tmdb.org/t/p/original/kQgMYFqB3dguDWXH0dIIrfmStux.jpg","poster_path":"https://image.tmdb.org/t/p/original/4V51agB0jnQP1dQMSrtk8vNqZpA.jpg","certification":"10","genres":["Família","Comédia"],"trailer":"N/A"},
