"54518":{"id":"54518","name":"Justin Bieber: Never Say Never","slug":"justin-bieber-never-say-never","original_title":"Justin Bieber: Never Say Never","overview":"Documentário sobre a vida e a turnê do cantor pop de grande sucesso Justin Bieber. Nascido no Canadá, o jovem desde cedo mostrou talento para a música ao tocar vários instrumentos como autodidata e logo despertou para o canto. Cantando na rua ou em concursos púbicos, Bieber foi conquistando seu espaço e na medida que seus vídeos na internet começaram a ter acessos fora do comum, um empresário americano viu nele potencial e investiu em sua carreira. Depois de receber diversas negativas, seguir na insistência e uma vez com o contrato assinado com uma gravadora, foi uma questão de tempo para que os shows começassem a acontecer uma após o outro. Era hora de começar a pensa num sonho: cantar no lendário Madison Square Garden, em Nova York, Estados Unidos.","first_air_date":"2011-02-11","runtime":105,"episode_run_time":[105],"vote_average":5.2,"created_by":["Insurge Pictures","Magical Elves","Scooter Braun Films","Paramount Pictures","L.A. Reid Media","AEG Live","MTV Films","The Island Def Jam Music Group"],"production_companies":[{"name":"Insurge Pictures"},{"name":"Magical Elves"},{"name":"Scooter Braun Films"},{"name":"Paramount Pictures"},{"name":"L.A. Reid Media"},{"name":"AEG Live"},{"name":"MTV Films"},{"name":"The Island Def Jam Music Group"}],"cast":["Justin Bieber","Nathan Morris","Wanya Morris","Shawn Stockman","Miley Cyrus"],"backdrop_path":"https://image.tmdb.org/t/p/original/wsuO9N3t89buTgtzJ5vUMBCHBB6.jpg","poster_path":"https://image.tmdb.org/t/p/original/dGNMD5XTBQN3teIth21ohKOCJcR.jpg","certification":"N/A","genres":["Música","Documentário","Família"],"trailer":"N/A"},
